
function GetURLParameter(name, url) {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, "\\$&");
    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, " "));
}

//const ws = new WebSocket('ws://' + GetURLParameter('cloudIp'));
const ws = new WebSocket('ws://localhost');

function sendToCloud(command) {
	ws.send(JSON.stringify({"command": command}));
}

// Navigation's buttons functions
function flashlight() {
	console.log('flashlight');

	let buttonClass = document.getElementById('flash').classList;
	let command = buttonClass.contains('on') ? 'FL_0' : 'FL_1';

	sendToCloud(command);
}

function turnLeft(num) {
	console.log('turn left: ' + num);
	sendToCloud('TU_-' + num);
}

function forward() {
	console.log('go forward');
	sendToCloud('FO_30');
}

function stop() {
	console.log('stop');
	sendToCloud('ST');
}

function back() {
	console.log('go back');
	sendToCloud('FO_-30');
}

function turnRight(num) {
	console.log('turn right: ' + num);
	sendToCloud('TU_' + num);
}

var mapCoordinates = []
var mapWidth = 2000;
var mapHeight = 2000;
var mapRobotLocation = [];
var mapTarget = [];

function drawMap() {
    var c = document.getElementById("myCanvas");
    c.width = mapWidth;
    c.height = mapHeight;
    var ctx = c.getContext("2d");

    // Clear previous shapes
    ctx.clearRect(0, 0, c.width, c.height);

    // Paint bg white
    ctx.fillStyle = "white";
    ctx.fillRect(0, 0, c.width, c.height);


    // Paint walls/barriers
    ctx.fillStyle = "black";
    c.addEventListener("click", printMousePos);

    if (mapCoordinates.length === 0) {
        ctx.font = "" + mapWidth/10 + "px Arial";
        ctx.fillText('Get Map', 10, mapWidth / 10);
        console.log('map empty');
        return;
    }
    
    for (i = 0; i < mapCoordinates.length; i++) {
        ctx.fillRect(mapCoordinates[i][0], mapCoordinates[i][1], 1, 1);
    }

    // Define square radius
    var r = (5 / 400) * Math.min(mapWidth, mapHeight);

    // Paint robot location
    if (mapRobotLocation.length === 2) {
        ctx.fillStyle = "blue";
        ctx.fillRect(mapRobotLocation[0] - r, mapRobotLocation[1] - r, 2*r, 2*r);
    }

    // Paint target location
    if (mapTarget.length === 2) {
        ctx.fillStyle = "red";
        ctx.fillRect(mapTarget[0] - r, mapTarget[1] - r, 2 * r, 2 * r);
    }
}




