// AUX function
function toggleColor(buttonId, color) {
	let classList = document.getElementById(buttonId).classList;
	classList.toggle(color);
}

function updateState(str) {
	document.getElementsByTagName('p')[0].innerHTML = str;
}

function startsWith(str, prefix) {
	return str.indexOf(prefix) === 0;
}

function changeColorAndStateForCmd(msg) {
	const cmd = msg.substr(2);
	const commandToState = {'FL_1': 'Flashlight ON',
							'FL_0': 'Flashlight OFF',
							'TU_-90': 'Turning 90 degrees left',
							'TU_-45': 'Turning 45 degrees left',
							'TU_-20': 'Turning 20 degrees left',
							'FO_30': 'Moving forward',
							'ST': 'Stopping',
							'FO_-30': 'Moving backwards',
							'TU_20': 'Turning 20 degrees right',
							'TU_45': 'Turning 45 degrees right',
							'TU_90': 'Turning 90 degrees right',
                           };
	if (cmd in commandToState) {
		let id;
		switch(cmd) {
			case 'FO_30': toggleColor('forward', 'on'); break;
			case 'ST': toggleColor('stop', 'on');   break;
			case 'FO_-30': toggleColor('back', 'on');	break;
			case 'FL_1':
			case 'FL_0': {
				if (!startsWith(msg, 'S_'))
					toggleColor('flash', 'on');
			}
		}
        // Reset target if manually moved
        if (!startsWith(cmd, 'FL_')) mapTarget = [];

		if (startsWith(msg, 'C_')) updateState(commandToState[cmd]);
		if (startsWith(msg, 'F_')) updateState('FAILED ' + commandToState[cmd]);
		if (startsWith(msg, 'S_')) updateState('Resting');
	}

    // If MV request was acknowleged
    if (cmd.startsWith('MV_')) {
        if (startsWith(msg, 'F_'))
            updateState(`FAILED Move to target`);
        else {
            mapTarget = cmd.substr(3).split('_').map(x => parseInt(x));
            drawMap();
        }
    }
}

function parseMapStringAndShow(rawData) {
    var data = rawData.split("|");
    // Find dimensions and parse (eg: "2000x2000" => [2000,2000])
    var dimensions = data[1].split(':')[1].split('x').map(x => parseInt(x));
    // Split coordinates into pairs(eg: "111,222 333,444 ..." => ["111,222","333,444",...])
    var coordinatesStrings = data[2].split(' ');
    // Split pairs into lists, then parse (eg: ["111,222","333,444",...] => [[111,222],[333,444],...])
    var coordinates = coordinatesStrings.map(coord => coord.split(',').map(x => parseInt(x)));
    mapCoordinates = coordinates;
    mapWidth = dimensions[0];
    mapHeight = dimensions[1];
    drawMap();
    return;
}

// Handling Cloud's messages
ws.onmessage = function (msg) {
    console.log('Message from Cloud: ' + msg.data);

    // handle Robot's state
    const states = { established: 'Resting', closed: '', error: '' };
    
    const data = JSON.parse(msg.data);
    if ('robot_conn' in data) {
        let classList = document.body.classList;
        for (const s in states) {
            const className = 'state-' + s;
            if (classList.contains(className)) classList.remove(className);
            if (data.robot_conn === s) {
                classList.add(className);
                updateState(states[s]);
            }
        }
    }
    // handle confirm/success/failed messages
    if ('conf' in data) {
        changeColorAndStateForCmd(data.conf);

        if (startsWith(data.conf, 'OBS'))
            parseMapStringAndShow(data.conf);
        if (startsWith(data.conf, 'XY_')) {
            mapRobotLocation = data.conf.substr(3).split('_').map(x => parseInt(x));
            console.log('mapRobotLocation ' + mapRobotLocation[0] + ' ' + mapRobotLocation[1])
            // reset target if reached
            if (mapRobotLocation[0] === mapTarget[0] && mapRobotLocation[1] === mapTarget[1])
                mapTarget = [];
            drawMap();
        }
    }
};


function printMousePos(event) {
    if (mapCoordinates.length === 0) {
        sendToCloud('MAP');
        return;
    }
    var clickX = (event.layerX / 400) * mapWidth;
    var clickY = (event.layerY / 400) * mapHeight;
    console.log(`move to: ${clickX}, ${clickY}`);
    // Check if a wall was clicked
    if (mapCoordinates.findIndex(c => c[0]===clickX && c[1]===clickY) >= 0)
        alert('That place is not empty. Please click a white area instead.');
    else
        sendToCloud(`MV\n${clickX}\n${clickY}`);
}
drawMap();

